import React from 'react'
import {CoursesWrapper, ModuleWrapper, ModuleGrid, Course, CourseHeadline} from './CoursesElements'


const Body = ({
    headline
}) => {


    return (
        <CoursesWrapper>
            <ModuleWrapper>
                <ModuleGrid>
                    <Course>
                        <CourseHeadline>
                            {headline}
                        </CourseHeadline>
                    </Course>
                    <Course>
                    </Course>
                </ModuleGrid>
            </ModuleWrapper>
        </CoursesWrapper>
    )
}

export default Body
